    alignItems: 'center',
    justifyContent: 'center',
    height: '120px'
};

const dateSelectorField = {
    width: '30%'
};

function Rent() {
    return (
        <>
            {!music.length && <div>
                <h1>К сожалению, пока ничего не найдено :(</h1>
            </div>}
            <IntervalSelector/>
            <TruckTable/>
        </>
    );
}

export default Rent;
